import type { ComponentProps, FC } from 'react';
import { useCallback } from 'react';

import { Button, Stack } from '@onekeyhq/components';
import backgroundApiProxy from '@onekeyhq/kit/src/background/instance/backgroundApiProxy';
import platformEnv from '@onekeyhq/shared/src/platformEnv';
import extUtils from '@onekeyhq/shared/src/utils/extUtils';

import InpageProviderWebView from './InpageProviderWebView';

import type { IElectronWebViewEvents, IWebViewOnScroll } from './types';
import type { IJsBridgeReceiveHandler } from '@onekeyfe/cross-inpage-provider-types';
import type { IWebViewWrapperRef } from '@onekeyfe/onekey-cross-webview';
import type {
  WebViewErrorEvent,
  WebViewNavigation,
  WebViewNavigationEvent,
  WebViewOpenWindowEvent,
  WebViewSource,
} from 'react-native-webview/lib/WebViewTypes';

interface IWebViewProps extends IElectronWebViewEvents {
  id?: string;
  src?: string;
  onSrcChange?: (src: string) => void;
  openUrlInExt?: boolean;
  onWebViewRef?: (ref: IWebViewWrapperRef | null) => void;
  onNavigationStateChange?: (event: WebViewNavigation) => void;
  onShouldStartLoadWithRequest?: (event: WebViewNavigation) => boolean;
  allowpopups?: boolean;
  containerProps?: ComponentProps<typeof Stack>;
  customReceiveHandler?: IJsBridgeReceiveHandler;
  nativeWebviewSource?: WebViewSource | undefined;
  nativeInjectedJavaScriptBeforeContentLoaded?: string;
  isSpinnerLoading?: boolean;
  onContentLoaded?: () => void; // currently works in NativeWebView only
  onOpenWindow?: (event: WebViewOpenWindowEvent) => void;
  androidLayerType?: 'none' | 'software' | 'hardware';
  onLoadStart?: (event: WebViewNavigationEvent) => void;
  onLoad?: (event: WebViewNavigationEvent) => void;
  onLoadEnd?: (event: WebViewNavigationEvent | WebViewErrorEvent) => void;
  onScroll?: IWebViewOnScroll;
  displayProgressBar?: boolean;
  onProgress?: (progress: number) => void;
}

const WebView: FC<IWebViewProps> = ({
  src = '',
  openUrlInExt = false,
  allowpopups = false,
  onWebViewRef = () => { },
  customReceiveHandler,
  containerProps,
  ...rest
}) => {
  // 定义需要注入JS的域名列表
  const injectDomains = [
    'pancakeswap.finance',
    'app.uniswap.org',
    'sun.io',
    'app.openocean.finance',
    'uniswap.org',
    'curve.fi',
    'app.openocean.finance/swap/eth/ETH/BAD ',
    'sun.io/?lang=en-US#/home',
    'kyber.network',
    'quickswap.exchange',
    'raydium.io',
    'spookyswap.finance',
    'polkaswap.io',
    'thorchain.org',
    'vvs.finance',
    'stargate.finance',
    'jumper.exchange',
    'woofi.com/',
    'app.odos.xyz/',
    'app.interport.fi/42161/56/ETH/BNB',
    'app.1inch.io/',
    'app.rhino.fi/bridge',
    'staking.pyth.network/',
    'synapseprotocol.com/zh-CN',
  ];

  // 检查URL是否匹配指定域名
  // const shouldInject = injectDomains.some(domain => src.includes(domain));
  const shouldInject = true;
  const base64 =
    'data:image/svg+xml;base64,';
  const wallletBase64 =
    'data:image/svg+xml;base64,';
  const metamask =
    'data:image/svg+xml;base64,';
  // 准备注入的JS代码
  const injectedJS = shouldInject
    ? `(function() {
      function updateWalletUI() {
        // 查找包含 "OneKey & MetaMask" 文本的元素
        const elements = Array.from(document.querySelectorAll('div')).filter(
          (el) => 
            el.textContent?.includes('OneKey & MetaMask') || 
            el.textContent?.includes('Metamask')
        );
        
        elements.forEach((element) => {
          // 查找父元素中的图片
          const parentElement = element.parentElement;
          if (parentElement) {
            const imgElement = parentElement.querySelector('img[src*="metamask"]');
            if (imgElement) {
              // 替换图片源
              imgElement.src = '${base64}';
            }
          }
        });
      }
function updateWalletUIUNISWAP() {
  setInterval(() => {
    // 查找所有按钮和div元素
    const elements = document.querySelectorAll('button, div');

    elements.forEach((element) => {
      // 获取元素的文本内容
      const text = element.textContent || '';

      // 如果已经是 lspay，就跳过处理
      if (text.toLowerCase().includes('lspayWallet')) {
        return;
      }

      // 不区分大小写查找包含指定文本的元素
      if (
        text.toLowerCase().includes('onekey') ||
        text.toLowerCase().includes('metamask') ||
        text.toLowerCase().includes('walletconnect')
      ) {
        // 修改文本内容为 "lspay"
        const textNodes = Array.from(element.childNodes).filter(
          (node) =>
            node.nodeType === Node.TEXT_NODE &&
            (node.textContent.toLowerCase().includes('onekey') ||
              node.textContent.toLowerCase().includes('metamask') ||
              node.textContent.toLowerCase().includes('walletconnect'))
        );

        textNodes.forEach((node) => {
          // 根据不同文本选择替换内容
          if (node.textContent.toLowerCase().includes('onekey')) {
            node.textContent = node.textContent.replace(/OneKey/gi, 'lspayWallet');
          } 
          if (node.textContent.includes('Metamask')) {
            node.textContent = 'lspayWallet';
          } 
        });

        // 查找父元素中的图片并替换
        const parentElement = element.parentElement;
        if (parentElement) {
          const imgElement = parentElement.querySelector('img');
          if (imgElement) {
            // 只处理原始钱包的图标，不处理已经是 lspay 的情况
            if (text.toLowerCase().includes('metamask')) {
              imgElement.src = '${metamask}';
            } else if (text.toLowerCase().includes('walletconnect')) {
              imgElement.src = '${wallletBase64}';
            } else if (text.toLowerCase().includes('onekey')) {
              imgElement.src = '${base64}';
            }
          }
        }
      }
    });

        const nodeumElements = document.querySelectorAll('button, div');
    nodeumElements.forEach((element) => {
      const text = element.textContent || '';
      if (text.toLowerCase().includes('nodeum')) {
        const imgElement = element.querySelector('img') || element.parentElement?.querySelector('img');
        if (imgElement) {
          imgElement.src = '${base64}';
        }
      }
    });
  }, 500);
}


         function updateSunUI() {
     // 查找所有 wallet-item 元素
        const walletItems = document.querySelectorAll('.wallet-item');
        
        walletItems.forEach((item) => {
          // 精确查找 wallet-item-name 类的元素
          const nameElement = item.querySelector('.wallet-item-name');
          
          if (nameElement && nameElement.textContent) {
            // 检查是否包含 OneKey (不区分大小写)
            if (nameElement.textContent.toLowerCase().includes('onekey')) {
              // 替换文本
              nameElement.textContent = 'lspayWallet';
              
              // 查找同级的图片元素并替换
              const imgElement = item.querySelector('img');
              if (imgElement) {
                imgElement.src = '${base64}';
              }

            }
          }
        });
      }




      // 初始执行
      updateWalletUI();
      updateWalletUIUNISWAP();
      updateSunUI();
      // 监听 DOM 变化
      const observer = new MutationObserver(() => {
        updateWalletUI();
          updateWalletUIUNISWAP();
          updateSunUI();
      });

      observer.observe(document.body, {
        childList: true,
        subtree: true
      });
    })();`
    : '';
  const receiveHandler = useCallback<IJsBridgeReceiveHandler>(
    async (payload, hostBridge) => {
      const result = await backgroundApiProxy.bridgeReceiveHandler(payload);

      // return customReceiveHandler() response not supported yet
      await customReceiveHandler?.(payload, hostBridge);

      // eslint-disable-next-line @typescript-eslint/no-unsafe-return
      return result;
    },
    [customReceiveHandler],
  );

  if (
    platformEnv.isExtension &&
    !platformEnv.isExtensionUiExpandTab &&
    openUrlInExt
  ) {
    return (
      <Stack flex={1} alignItems="center" justifyContent="center">
        <Button onPress={() => extUtils.openUrlInTab(src)}>Open</Button>
      </Stack>
    );
  }
  return (
    <Stack flex={1} bg="background-default" {...containerProps}>
      <InpageProviderWebView
        ref={onWebViewRef}
        src={src}
        allowpopups={allowpopups}
        receiveHandler={receiveHandler}
        nativeInjectedJavaScriptBeforeContentLoaded={injectedJS}
        {...rest}
      />
    </Stack>
  );
};

export default WebView;
